khong du trinh do:
- id: 47bic
  res: 'Không đủ trình độ chuyên môn !

    Đây là nhận xét của tôi trong tư cách một chuyên gia về server Minecraft, đối
    với phần lớn những người được gọi là "police" hiện nay.

    Những người này sống dựa vào các server như 3fmc, heromc hoặc các server đến từ
    nước ngoài. Một cách trực tiếp hay gián tiếp họ nhận tiền để nói về tình trạng
    hack của server.

    Việc nhận tiền, ở một khía cạnh nào đó là có thể chấp nhận được, coi như trả công
    làm việc cho họ. Tuy nhiên, như đã nói, phần lớn những người này không có trình
    độ chuyên môn vì không được làm việc trực tiếp với các server admin, để hiểu các
    công nghệ trong nghiên cứu, code plugin, từ lập trình java, vẽ model, design menu,
    đến các quy trình xây dựng danh tiếng.

    Do không có trình độ chuyên môn, nên khi bắt hack, họ hầu như sẽ nói theo những
    gì server đưa cho họ. Như vậy, họ không giữ được sự khách quan, độc lập của một
    police đúng nghĩa. Nhận được nhiều tiền, thường xuyên thì có xu hướng nói tốt
    cho anticheat của server tương ứng. Không đưa tiền thì không nói.



